using System;
using HackerRank.Net.Strings;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace HackerRank.Net.Tests.Strings
{
    [TestClass]
    public class BearAndSteadyGeneTests
    {
        [TestMethod]
        public void When_GAAATAAA_Should_Return_5()
        {
            var input = "GAAATAAA";
            var expected = 5;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }


        [TestMethod]
        public void When_TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC_Should_Return_5()
        {
            var input = "TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC";
            var expected = 5;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }

        [TestMethod]
        public void When_Test2_Should_Return_0()
        {
            var input = "";
            var expected = 0;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }

        [TestMethod]
        public void When_AGTC_Should_Return_0()
        {
            var input = "AGCT";
            var expected = 0;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }

        [TestMethod]
        public void When_Test4_Should_Return_24()
        {
            var input = "CGCCACCCACAACGCATCGCATACGAAGGCCACGGGTCGGCGTGCGCTGCCGCGACAGTCTGTCCAGGGGCCCGTCGCGAGTGGTTTGGAGTAGTCGTGGCATCACCGGTAACCGG";
            var expected = 24;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }

        [TestMethod]
        public void When_Test6_Should_Return_150017()
        {
            var input = "";
            var expected = 150017;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }
        [TestMethod]
        public void When_Test4_Should_Return_2()
        {
            var input = "CCAA";
            var expected = 2;
            int actual = BearAndSteadyGene.Stabilize(input);
            Assert.AreEqual(expected, actual);
        }
    }
}
